Here's a sample Spark job in Java that calculates the hit rate for the onsite attributed data based on the top frequent queries:

```java
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.Function2;
import scala.Tuple2;

import java.io.Serializable;
import java.util.HashMap;
import java.util.Map;

public class HitRateCalculator implements Serializable {
    private static final long CACHE_DURATION = 12 * 60 * 60 * 1000; // 12 hours in milliseconds

    public static void main(String[] args) {
        // Assuming you have the Spark context set up
        // JavaSparkContext sc = ...

        // Load the onsite attributed data and top frequent queries
        JavaRDD<String> onsiteAttributedData = sc.textFile("path/to/onsite_attributed_data");
        JavaRDD<String> topFrequentQueries = sc.textFile("path/to/top_frequent_queries");

        // Convert the top frequent queries to a set for faster lookup
        final Map<String, Long> cache = new HashMap<>();
        final Map<String, Long> queryTimestamps = new HashMap<>();

        // Calculate the hit rate
        JavaRDD<Tuple2<String, Integer>> hitRateData = onsiteAttributedData.map(new Function<String, Tuple2<String, Integer>>() {
            @Override
            public Tuple2<String, Integer> call(String record) throws Exception {
                String[] fields = record.split(",");
                String query = fields[0];
                long timestamp = Long.parseLong(fields[1]);

                if (topFrequentQueries.contains(query)) {
                    Long cachedTimestamp = cache.get(query);
                    if (cachedTimestamp != null && timestamp - cachedTimestamp <= CACHE_DURATION) {
                        // Cache hit
                        return new Tuple2<>(query, 1);
                    } else {
                        // Cache miss
                        cache.put(query, timestamp);
                        queryTimestamps.put(query, timestamp);
                        return new Tuple2<>(query, 0);
                    }
                } else {
                    // Query not in top frequent queries
                    return new Tuple2<>(query, -1);
                }
            }
        });

        // Calculate the total hits and total queries
        Tuple2<Integer, Integer> hitRateResult = hitRateData.aggregate(new Tuple2<>(0, 0),
                new Function2<Tuple2<Integer, Integer>, Tuple2<String, Integer>, Tuple2<Integer, Integer>>() {
                    @Override
                    public Tuple2<Integer, Integer> call(Tuple2<Integer, Integer> acc, Tuple2<String, Integer> record) throws Exception {
                        int hit = record._2();
                        if (hit == 1) {
                            return new Tuple2<>(acc._1() + 1, acc._2() + 1);
                        } else if (hit == 0) {
                            return new Tuple2<>(acc._1(), acc._2() + 1);
                        } else {
                            return acc;
                        }
                    }
                },
                new Function2<Tuple2<Integer, Integer>, Tuple2<Integer, Integer>, Tuple2<Integer, Integer>>() {
                    @Override
                    public Tuple2<Integer, Integer> call(Tuple2<Integer, Integer> acc1, Tuple2<Integer, Integer> acc2) throws Exception {
                        return new Tuple2<>(acc1._1() + acc2._1(), acc1._2() + acc2._2());
                    }
                });

        int totalHits = hitRateResult._1();
        int totalQueries = hitRateResult._2();

        double hitRate = (double) totalHits / totalQueries;

        System.out.println("Hit Rate: " + hitRate);
    }
}
```

