 We can use React Context to create a global state for the Tooltip component.

## Create Tooltip Context

Create a new file called TooltipContext.js in the context folder.
```
import { createContext, useContext, useState } from 'react';

const TooltipContext = createContext();

export const useTooltip = () => useContext(TooltipContext);

export const TooltipProvider = ({ children }) => {
  const [tooltipOpen, setTooltipOpen] = useState(false);

  const openTooltip = () => {
    setTooltipOpen(true);
  };

  const closeTooltip = () => {
    setTooltipOpen(false);
  };

  return (
    <TooltipContext.Provider value={{ tooltipOpen, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```
## Wrap the App with the TooltipProvider

In the _app.js file, wrap the Component with the TooltipProvider.
```
import { TooltipProvider } from '../context/TooltipContext';

function MyApp({ Component, pageProps }) {
  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
}

export default MyApp;
```
## Create the Tooltip Component

Create a new file called Tooltip.js in the components folder.
```
import { useTooltip } from '../context/TooltipContext';

const Tooltip = ({ children, text }) => {
  const { tooltipOpen, openTooltip, closeTooltip } = useTooltip();

  return (
    <div
      className="relative"
      onMouseEnter={openTooltip}
      onMouseLeave={closeTooltip}
    >
      {children}
      {tooltipOpen && (
        <div className="absolute top-0 left-0 z-10 bg-black text-white p-2 rounded">
          {text}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```
## Usage

Now you can use the Tooltip component in any part of your application.
```
import Tooltip from '../components/Tooltip';

const Home = () => {
  return (
    <div>
      <h1>Home</h1>
      <Tooltip text="This is a tooltip">
        <button>Hover me</button>
      </Tooltip>
    </div>
  );
};

export default Home;
```
