Here's an example of how you can create a layout component with Tailwind CSS that has two variants, full-width and centered, using the className prop to conditionally apply the styles:

```jsx
import React from 'react';

const Layout = ({ children, className }) => {
  return (
    <div className={`layout ${className}`}>
      {children}
    </div>
  );
};

export default Layout;
```

In this example, the `Layout` component is a simple wrapper that accepts `children` and a `className` prop. The `className` prop is used to conditionally apply the styles for the two variants.

To define the styles for the variants, you can use Tailwind CSS utility classes. Here's an example of how you can define the styles in your Tailwind CSS configuration file (e.g., `tailwind.config.js`):

```js
module.exports = {
  theme: {
    extend: {
      maxWidth: {
        'layout-centered': '1200px',
      },
    },
  },
  plugins: [],
};
```

In this configuration, we extend the `maxWidth` theme to include a custom value called `layout-centered` with a value of `1200px`. This custom value will be used for the centered variant.

Now, you can use the `Layout` component in your application and pass the appropriate className prop to apply the desired variant styles. Here's an example:

```jsx
import React from 'react';
import Layout from './Layout';

const App = () => {
  return (
    <div>
      <Layout className="max-w-full">
        <h1>Full-width Layout</h1>
        {/* Content for full-width layout */}
      </Layout>

      <Layout className="max-w-layout-centered mx-auto">
        <h1>Centered Layout</h1>
        {/* Content for centered layout */}
      </Layout>
    </div>
  );
};

export default App;
```

In this example, we use the `Layout` component twice, once for the full-width variant and once for the centered variant.

