Here's a WordPress function that allows you to use a shortcode to display a list of custom posts with the specified parameters:

```php
function custom_post_list_shortcode($atts) {
    $atts = shortcode_atts(array(
        'number' => -1,
        'category' => '',
        'taxonomy' => ''
    ), $atts);

    $args = array(
        'post_type' => 'custom_post_type',
        'posts_per_page' => intval($atts['number']),
        'tax_query' => array(
            'relation' => 'AND'
        )
    );

    if (!empty($atts['category'])) {
        $args['tax_query'][] = array(
            'taxonomy' => 'category',
            'field' => 'slug',
            'terms' => $atts['category']
        );
    }

    if (!empty($atts['taxonomy'])) {
        $args['tax_query'][] = array(
            'taxonomy' => $atts['taxonomy'],
            'field' => 'slug',
            'terms' => $atts['taxonomy']
        );
    }

    $query = new WP_Query($args);

    if ($query->have_posts()) {
        $output = '<ul>';
        while ($query->have_posts()) {
            $query->the_post();
            $output .= '<li>';
            $output .= '<h3>' . get_the_title() . '</h3>';
            $output .= '<div>' . get_the_content() . '</div>';
            $output .= '</li>';
        }
        $output .= '</ul>';
    } else {
        $output = '<p>No posts found.</p>';
    }

    wp_reset_postdata();

    return $output;
}
add_shortcode('custom_post_list', 'custom_post_list_shortcode');
